"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?40/32/41476/abstract/1\">",
"      Section on Breastfeeding. Breastfeeding and the use of human milk. Pediatrics 2012; 129:e827.",
"     </a>",
