"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?40/32/41476/abstract/4\">",
"      Macknin ML, Medendorp SV, Maier MC. Infant sleep and bedtime cereal. Am J Dis Child 1989; 143:1066.",
"     </a>",
